import { Link } from 'react-router-dom';

const CompanyMenu = () => (
  <>
    <Link to="/dashboard/company">หน้าหลัก</Link>
<Link to="/company/jobs">ประกาศ</Link>
<Link to="/company/status">สถานะ</Link>
<Link to="/company/evaluation">ประเมิน</Link>
<Link to="/company/profile">โปรไฟล์</Link>
  </>
);

export default CompanyMenu;
